INSERT INTO `counsel` VALUES (4,'2025-03-17','다이어트 중 단백질 섭취량이 궁금해요','<p>체중 감량 중인데 단백질을 얼마나 섭취해야 할지 모르겠어요. 체중 60kg 기준으로 하루 권장량이 궁금합니다.</p>',NULL,2),(5,'2025-03-17',' 비타민D는 어떻게 보충하나요?','<p>최근 건강검진에서 비타민D가 부족하다는 진단을 받았어요. 어떻게 보충해야 할까요?</p>',NULL,3),(6,'2025-03-17','채식 중 철분 섭취가 고민이에요','<p>채식 위주로 식단을 유지 중인데, 철분 섭취가 부족한 것 같아요. 좋은 식품이 있을까요?</p>',NULL,4),(7,'2025-03-17','운동 전 후로 먹으면 좋은 음식은?','<p>헬스 운동을 하는데 운동 전후로 어떤 음식을 먹어야 더 도움이 될까요?</p>',NULL,5),(8,'2025-03-17','물을 얼마나 마셔야 할까요?','<p>하루에 물을 얼마나 마셔야 건강에 좋은가요?</p>',NULL,6);
/*!40000 ALTER TABLE `counsel` ENABLE KEYS */;
