INSERT INTO `counselanswer` VALUES (3,'2025-03-17','일반적으로 체중 1kg당 약 300ml의 물을 마시는 것이 권장됩니다. <br>체중이 60kg이라면 하루 약 1.8L2.1L를 목표로 하세요. <br>단, 운동이나 더운 날씨에서는 더 많은 수분이 필요할 수 있습니다. <br>자주 목이 마르지 않게 꾸준히 물을 섭취하세요.',1,8),(4,'2025-03-17','운동 전에는 바나나, 고구마, 오트밀과 같이 소화가 잘 되는 탄수화물과 소량의 단백질을 섭취하세요. <br>운동 후에는 단백질과 탄수화물이 함께 포함된 식사를 하시는 것이 좋습니다. <br>닭가슴살, 삶은 계란, 현미밥 등을 추천합니다.',1,7),(5,'2025-03-17','채식으로 철분을 보충하려면 시금치, 렌틸콩, 병아리콩, 두부, 브로콜리 등을 드시는 것이 좋습니다. <br>비타민C가 풍부한 과일과 함께 섭취하면 철분 흡수율이 높아집니다. <br>필요시 식물성 철분 보충제도 고려해 보세요.',1,6),(6,'2025-03-17','비타민D는 햇빛을 통해 자연스럽게 합성되지만, 음식이나 보충제를 통해 보충하는 것도 좋습니다.<br>연어, 고등어, 계란 노른자, 버섯 등이 풍부한 식품이며, 부족할 경우 비타민D 보충제를 섭취하는 것도 도움이 됩니다. <br>일주일에 2~3번 정도는 햇빛을 쬐는 것도 권장합니다.',1,5),(7,'2025-03-17','비타민D는 햇빛을 통해 자연스럽게 합성되지만, 음식이나 보충제를 통해 보충하는 것도 좋습니다.<br> 연어, 고등어, 계란 노른자, 버섯 등이 풍부한 식품이며, 부족할 경우 비타민D 보충제를 섭취하는 것도 도움이 됩니다. <br>일주일에 2~3번 정도는 햇빛을 쬐는 것도 권장합니다.',1,4);
/*!40000 ALTER TABLE `counselanswer` ENABLE KEYS */;
